import React from 'react';
import './todoitem.css';

function TodoItem(props) {
    const {items} = props;
  return (
    <div>
        
            <table>
                <tr>
                    <th> Subject</th>
                    <th> Lesson</th>
                </tr>
                {items.map((item)=>(    
                <tr key={item.id}>
                    <td>{item.subject}</td>
                    <td>{item.a}</td>
                </tr>
                ))}
            </table>
        
    </div>
  )
}

export default TodoItem
